import {newConsultation} from './newConsultation.js'
import {hideDivWithOpacityAnimation} from './showModal'
import io from 'socket.io-client'
const socket = io('/')

export async function save(){
    const object =  {
        student: {
          id:0,
          name: 'Kouassi Anne Esther',
          school: {libelle: 'ESCAE'},
          class: {libelle : 'ESCA'},
          registration: '21INP00269',
          photo: ''
        },
        date: '12/05/2023 11:30:23',
        restDuration: 48,
        diagnostic: JSON.stringify([])

      }
  const studentId = sessionStorage.getItem('studentId')

  object.name = document.querySelector("#profileName").innerText
  object.school.libelle = document.querySelector("#profileSchool").innerText
  object.class.libelle = document.querySelector("#profileClass").innerText


  const number = document.querySelector('.number > input').value
  const editorChild = Array.from(document.querySelector('.ql-editor').children).map(child =>{ return child.innerHTML})
  object.consultation.diagnostic = JSON.stringify(editorChild)
  object.consultation.restDuration = parseInt(number) 

  socket.emit('newConsultation',{studentId: studentId,restDuration:parseInt(number), diagnostic: JSON.stringify(editorChild) })
  socket.on('addSucced',(message)=>{
    console.log(message)
  })
  socket.on('addFailed',(message)=>{
    console.log(message)
  })
